import React from 'react';

import { useState } from 'react';
import { useContext } from 'react';
import { useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { UserContext } from '../../App';
import VolunteerInfo from './VolunteerInfo';


const Volunteer = () => {

    const [dataInfo, setDataInfo] = useState([])
    const { email } = useParams()
    const [loggedInUser, setLoggedInUser] = useContext(UserContext);


    useEffect(() => {
        fetch('http://localhost:4000/items?email='+loggedInUser.email)
            .then(res => res.json())
            .then(data => setDataInfo(data))
    }, [])


    // const [image, setImage] = useState([])
    // useEffect(() => {
    //     const matched = dataInfo.filter(pd => pd.email === email && email.toLowerCase())
    //     setImage(matched)

    // }, [email])


    return (
        <div>
            {
                dataInfo.map(img => <VolunteerInfo image={img} key={img.id}></VolunteerInfo>)
            }


        </div>

    );
};

export default Volunteer;
